

def openingBracket(char):
    return char == '['\
           or char == '{'\
           or char == '('

def closingBracket(char):
    return char == ']' \
           or char == '}'\
           or char == ')'

def matchBrackets(opening, closing):
    return (opening == '[' and closing == ']')\
           or (opening == '(' and closing == ')')\
           or (opening == '{' and closing == '}')

def isBalanced(str):
    stack = None
    for char in str:
        if openingBracket(char):
            if not stack:
                stack = []
            stack.append(char)
        elif closingBracket(char):
            if stack and (not matchBrackets(stack.pop(), char)):
                return "NO"

    return "YES" if stack == [] else "NO"


